import React from 'react'
import AvatarImg from '../../images/person-male.png'
import './Icon.css'
import Header from '../Header'

class Icon extends React.Component{

    render(){
        return (
            <div className='icon'>
                <img src={AvatarImg} style={{display:'inline-flex',alignItems:'end'}}/>
            </div>
        )
    }

}

export default Icon
